package double_pointers.six_eighty;

public class Solution2 {

    public static void main(String[] args) {
        String test = "abca";
        String test1 = "eeccccbebaeeabebccceea";
        String test2 = "ebcbbececabbacecbbcbe";
        String test3 = "abc";
        String test4 = "deeee";
        String test5 = "cbbcc";
        String test6 = "";
        boolean r = new Solution2().validPalindrome(test4);
        System.out.println(r);
    }

    public boolean validPalindrome(String s){
        int low = 0;
        int high = s.length() - 1;

        while(low<high){
            if(s.charAt(low)==s.charAt(high)){
                low++;
                high--;
            }else
                return checkPalindrome(s,low,high-1)||checkPalindrome(s,low+1,high);
        }

        return true;
    }

    public boolean checkPalindrome(String s,int low, int high){
        //System.out.println(s.charAt(low)+","+s.charAt(high));
        while(high>=low){
            if(s.charAt(low)==s.charAt(high)){
                if(low==high||low==high-1)
                    return true;
                low++;
                high--;
            }else{
                break;
            }
        }
        return false;
    }
}
